import { useState } from "react"

export const Entry = ({ listTransactions }) => {

    function infoEntry() {
        const cadastroEntradas = []

        listTransactions.forEach((cadastro) => {
            if (cadastro.tipo === "Entrada") {
                cadastroEntradas.push(cadastro)
            }
        })

        const entrada = cadastroEntradas.map(({ descricao, valor, tipo }) => {
            return (
                <li key={index} className="entry">
                    <div className="salary">
                        <h3>{descricao}</h3>
                        <span>{tipo}</span>
                    </div>

                    <div className="priceAndDelete">
                        <span>R$ {valor}</span>
                    </div>
                </li>
            )
        })

        return entrada
    }

    return (
        infoEntry()
    )
}
